} If you run this... Nothing will happen. Which makes sense, as we don't have any widgets that actually render anything. Lets add one and give it a size. impl WidgetView for MyWidget { fn build(&self, ctx: &mut BuildContext) -> BuildResult { build! { Button { layout: Layout { sizing: Sizing::Set { width: 64.0, height 32.0 } } } } }
} This should render a button on screen that's 64x32 pixels. Pretty swick, if I do say so myself. Button is one of our built-in widgets; its implementation is not important just yet, so don't worry about that for now. One important thing to note is clipping is not enabled by default. We'll cover why that is and the implications of that in a later section .

