Widgets may contain their own, self contained state, which persists across rebuilds (usually—more on that in a minute). Whenever the state changes, the widget's build() function will be re-invoked, and its children will be rebuilt. This is your main tool for implementing a user interface that can react to user events. Lets write up a quick counter example to demonstrate this: # #[functional_widget]
fn counter_widget(ctx: &BuildContext, font: FontId) -> BuildResult { let num = ctx.use_state(|| 0); let on_pressed = ctx.use_callback(|ctx, ()| { let mut num = ctx.get_state::<i32>(); *num += 1; }); build! { Column { children: [ Text::is(font, 32.0, format!("clicked: {} times", num.read())), Button { child: Padding { padding: Margin::All(10.0.into()), child: Text::is(font, 32.0, "A Button".into()) }, on_pressed } ] } }
} Any time you mutate state (for example, the num), it will cause any listening widgets to be rebuilt on the next update. The first time ctx.use_state(|| 0) is used, the closure within the method is called to initialize the state. In this case, it will be initialized to zero. On subsequent rebuilds of the widget, the previous state that it was in will be persisted. However, this only applies if the parent of the widget is not rebuilt. If you want to create state, but not listen to changes to it, you can instead use ctx.init_state. This is useful for widgets that manage state that children respond to, but state that itself doesn't react to. If you were to use that above, instead of use_state, the value would have changed internally, but you wouldn't see any change to the UI. On the same note, get_state fetches state without listening to it (much like init_state), but doesn't provide a default value: this means it may panic if you do not init the state, first. The use_callback function is used primarily to allow widgets to interact with each other. We create a callback and pass it into the button widget, letting us be notified when it is pressed. You may be wondering why we have to use get_state, and this is due to the guarantees Rust enforces. We must fetch the state from the widget in the callback, rather than cloning around pointers.

