} This houses all of the fields that the Button widget uses to determine how it will render. When it actually wants to utilize that style, we use the StyleExt extension trait. use agui::widgets::state::theme::StyleExt; # #[functional_widget]
fn button(ctx: &BuildContext, style: Option<ButtonStyle>, child: WidgetRef) -> BuildResult { // `resolve` will perform the following steps to get the style: // 1. If the style is `Some`, return it // 2. Check for a widget that's providing a Theme, and get_or_default from that // 3. Check global state for a Theme, and get_or_default from that // 4. Use the Default style let style: ButtonStyle = style.resolve(ctx); BuildResult::None
} Notice that the style field is an Option. The StyleExt trait also supports this type, making it simple to allow style overrides without additional checks.

