This is a convenience macro. It's not technically required (in fact it's quite easy to never use it) but it makes our life a bit easier. In exchange for some black-box magic, you get better maintainability and better looking code. It supports pretty much all of Rust syntax, so you can embed logic (such as if or match statements) within it as normal. // Before:
fn build(&self, ctx: &mut BuildContext) -> BuildResult { BuildResult::Some(vec![ Button { layout: Layout { sizing: Sizing::Set { width: 64.0, height 32.0 }, ..Layout::default() }.into(), ..Button::default() }.into() ])
} // After:
fn build(&self, ctx: &mut BuildContext) -> BuildResult { build!{ Button { layout: Layout { sizing: Sizing::Set { width: 64.0, height 32.0 } } } }
} Doesn't that look nice? Essentially all it is doing is adding .into() to your blocks and adding Default::default() to your structs. Note that it does make many assumptions, notably that every struct will #[derive(Default)].

